lt;/li&gt;\n          &lt;li&gt; Dask.Distributed Version: 0+unknown &lt;/li&gt;\n        &lt;/ul&gt;\n        &lt;h2&gt; Calling Code &lt;/h2&gt;\n        &lt;pre&gt;\nimport yaml\nfrom dask_interface import Initialization\nimport dask\nimport dask.array as da\nfrom dask.distributed import performance_report\nimport time\n\ndef Derivee(F, dx, periodic=0):\n    \"\"\"\n    First Derivative\n       Input: F        = function to be derivate\n              dx       = step of the variable for derivative\n              periodic = 1 if F is periodic\n       Output: dFdx = first derivative of F\n    \"\"\"\n    nx   = len(F)\n    #dFdx = 0. * F\n    c0 = 2. / 3.\n    dFdx = c0 / dx * (F[3:nx - 1] - F[1:nx - 3] - (F[4:nx] - F[0:nx - 4]) / 8.)\n    return dFdx\n\n# Get configuration\nwith open(r'config.yml') as file:\n    data = yaml.load(file, Loader=yaml.FullLoader)\n    Sworkers = data[\"workers\"]\n\n# Scheduler file name \nscheduler_info = 'scheduler.json'\n\n# Initialize the Deisa Adaptor \nAdaptor = Initialization(Sworkers, scheduler_info)\n\n# Check if client version is compatible with scheduler version\nAdaptor.client.get_versions(check=True)\n\n# Get data descriptor as a dict of Dask arrays\narrays = Adaptor.get_data()\n\n\n# py-bokeh is needed if you wanna see the perf report \nwith performance_report(filename=\"dask-report.html\"):\n   t = time.time()\n   # Get the Dask array global_t\n   gt = arrays[\"global_t\"]    \n   #gt = gt.rechunk({0: 1})\n   #print(gt.chunks)\n   # Construct a lazy task graph \n   der = Derivee(gt[::2], 1) \n   cpt =  da.linalg.norm(der, axis=(1,2))\n\n   # Submit the task graph to the scheduler\n   s = Adaptor.client.compute(cpt)\n   # Print the result, note that \"s\" is a future object, to get the result of the computation, we call `s.result()` to retreive it.  \n   print(s.result(), flush=True)\n\nprint(\"Done in \", time.time() -t, \"secondes\")\nAdaptor.client.shutdown()\n\n\n        &lt;/pre&gt;\n        "},"id":"1401","type":"Div"},{"attributes":{"child":{"id":"bk-bandwidth-type-plot"},"title":"Bandwidth (Types)"},"id":"1408","type":"Panel"},{"attributes":{"child":{"id":"1075"},"title":"Worker Profile (administrative)"},"id":"1404","type":"Panel"},{"attributes":{"child":{"id":"1003"},"title":"Worker Profile (compute)"},"id":"1403","type":"Panel"},{"attributes":{"overlay":{"id":"1060"}},"id":"1057","type":"BoxZoomTool"},{"attributes":{"tools":[{"id":"1056"},{"id":"1057"},{"id":"1058"},{"id":"1059"},{"id":"1072"}]},"id":"1061","type":"Toolbar"},{"attributes":{},"id":"1191","type":"CategoricalScale"},{"attributes":{"coordinates":null,"formatter":{"id":"1495"},"group":null,"major_label_policy":{"id":"1496"},"ticker":{"id":"1379"}},"id":"1378","type":"DatetimeAxis"},{"attributes":{"callback":null},"id":"1056","type":"TapTool"},{"attributes":{"style":{"border":"1px solid lightgray","box-shadow":"inset 1px 0 8px 0 lightgray","height":"100%","max-height":"1080px","max-width":"1920px","overflow":"auto","padding":"12px","width":"100%"},"text":"\n    \n        &lt;p style=\"font-family: monospace; margin: 0;\"&gt;distributed.scheduler - INFO - -----------------------------------------------&lt;/p&gt;\n    \n\n    \n        &lt;p style=\"font-family: monospace; margin: 0;\"&gt;distributed.scheduler - INFO - Clear task state&lt;/p&gt;\n    \n\n    \n        &lt;p style=\"font-family: monospace; margin: 0;\"&gt;distributed.scheduler - INFO -   Scheduler at:   tcp://172.21.2.236:8786&lt;/p&gt;\n    \n\n    \n        &lt;p style=\"font-family: monospace; margin: 0;\"&gt;distributed.scheduler - INFO -   dashboard at:                     :8787&lt;/p&gt;\n    \n\n    \n        &lt;p style=\"font-family: monospace; margin: 0;\"&gt;distributed.scheduler - INFO - Receive client connection: Client-70e42c15-98ab-11ed-96ce-080038b53e74&lt;/p&gt;\n    \n\n    \n        &lt;p style=\"font-family: monospace; margin: 0;\"&gt;distributed.scheduler - INFO - Receive client connection: Client-70e2cf70-98ab-11ed-a721-080038
